const certificateModule = (function(){
    return {
        generateCertificate: function(certificateData){
            const imageData = "data:image/png;base64,";
            
            let button = event.target;
            let level = button.getAttribute('level');
            let nameField = button.parentElement.previousElementSibling.children[0].children[0];
            let username = nameField.value;
            let date = new Date();

            //create document
            const doc = new jsPDF({
                orientation: "landscape",
            });
            // doc.addImage(imageData, 'JPEG', 15, 40, 180, 160)
            doc.addImage(imageData, 'PNG', 17, 14, 260, 184)

            doc.setFontSize(40);
            doc.setFont('Cinzel');
            doc.setTextColor('#CF0A63');
            doc.text(145, 60, 'CERTIFICATE', 'center');

            doc.setFontSize(25);
            doc.setTextColor('#4F1C33');
            doc.text(145, 70, 'OF ACHIEVEMENT', 'center');

            doc.setFontSize(18);
            doc.setFont('Merriweather');
            doc.setTextColor('#000000');
            doc.text(145, 87, 'Presented to', 'center');

            doc.setFontSize(35);
            doc.setFont('Cinzel');
            doc.setTextColor('#CF0A63');
            doc.text(145, 100, username, 'center');

            doc.setFontSize(15);
            doc.setFont('Merriweather');
            doc.setTextColor('#000000');
            doc.text(145, 110, 'For successfully completing the typing test and scoring below results', 'center');
            doc.text(145, 118, 'as documented and verified by Typing Master Co.', 'center');
            doc.setFontSize(18);
            doc.setTextColor('#4F1C33');
            doc.text(145, 130, 'Level: '+ level, 'center');
            doc.text(145, 138, 'Average Speed: '+ certificateData.wpm +' WPM', 'center');
            doc.text(145, 146, 'Accuracy: '+ certificateData.accuracy +'%', 'center');

            doc.setFontSize(15);
            doc.setTextColor('#000000');
            doc.text(60, 175, 'DATE: '+ date.toLocaleDateString('en-IN'));
            doc.text(220, 175, 'SIGNED: TYPING MASTER CO.', 'right');

            doc.save("Certificate.pdf");
        }
    };
})();